function GerarPDFCarteirinhaIndividual() {
    $.ajax({
        type: 'POST',
        data: ({
            codigoAluno: $('#CodAluno').val()
        }),
        url: '/Carteirinha/GerarCarteirinha/',
        success: function (data, textStatus, jqXHR) {
            if (data.length > 0) {
                criarDocPdfIndividual(data);
            }
            $('#alunoDialog').dialog("close");
        },
        error: function (jqXHR, textStatus, errorThrown) {
            $(document).ajaxStop(function () {
                Mensagem.Alert({
                    titulo: "Erro",
                    mensagem: "Ocorreu um erro durante o processo: " + errorThrown,
                    tipo: "Erro",
                    botao: "Fechar"
                });
            });
        }
    });
}
function criarDocPdfIndividual(carteirinhas) {

    var config = {
        pageOrientation: "portrait",
        pageSize: "A4",
        pageMargins: [30, 10, 30, 0],
        title: "Carteirinha"
    };

    sedPdfExporter.normalizeConfig(config);

    config.carteirinhas = carteirinhas;

    //config.debug = true;

    config.docGenerator = function (config) {
        var background = [
            { image: "bg", margin: [20, 220, 0, 20], width: 546 }
        ];
        var content = [];
        var cont = 0;

        for (i = 0; i < config.carteirinhas.length; i++) {
            var mod = (i & 3);

            content.push({ text: "Minha Carteirinha", style: "title" });

            content.push({ text: "Instruções", bold: true });

            content.push({
                ul: [
                            'O apelido é personalizável, caso queira alterar modifique o campo apelido.',
                            'Não utilize apelidos pejorativos',
                            'A carteirinha deve ser impressa em folha tamanho A4 nas configurações padrão  da impressora, sem adição de margens e orientação tipo retrato.',
                            'Utilize preferencialmente uma impressora de boa qualidade pois a imagem gerada é em alta definição.',
                            'Após a impressão, recorte os locais indicados.',
                            'Recomenda-se a conservação da carteirinha em plastico apropriado, ou a plastificação da mesma para evitar eventuais danos que prejudiquem a validação dos dados.',
                            'A carteirinha é de uso pessoal e intransferível.'
                ], fontSize: 10
            });

            content.push({ image: config.carteirinhas[i].urlFotoBase64.substring(0, 50) == "data:image/jpeg;base64,/9j/4QZ8RXhpZgAATU0AKgAAAAg" ? "foto" : config.carteirinhas[i].urlFotoBase64, margin: [280, !mod ? 92 : 104, 0, 0], width: 80 });

            content.push({ image: "arco", margin: [57, !mod ? -81.8 : -79.8, 20, 0], width: 479, height: 130, });

            content.push({ margin: [220, -78, 0, 0], canvas: [{ type: "rect", x: -25, y: 6, w: 62, h: 62, r: 5, color: "#fff" }] });

            content.push({ image: config.carteirinhas[i].urlQRBase64, margin: [198, -60, 0, 0], width: 58 });

            content.push({ text: config.carteirinhas[i].CodigoAlunoCriptografado, style: "codigo", margin: [195, 3, 0, 0] });

            content.push({ columns: [{ alignment: "justify", text: "", width: 220, margin: [30, -101, 0, 0], style: "obs" }] });

            content.push({ text: config.carteirinhas[i].Apelido, style: "apelido", margin: [0, -95, 5, 0] });

            content.push({ text: config.carteirinhas[i].NomeAlunoFormatado, style: "nome", margin: [0, 0, 5, 0] });

            content.push({ text: config.carteirinhas[i].nrRA + " - " + config.carteirinhas[i].nrDigRa + " / " + config.carteirinhas[i].sgUfRa, style: "outros", margin: [0, 0, 5, 0] });

            content.push({ text: "Nasc: " + config.carteirinhas[i].DataNascimento, style: "outros", margin: [0, 0, 5, 0] });

            //content.push({ text: config.carteirinhas[i].Diretoria + " / " + config.carteirinhas[i].Municipio, style: "outros", margin: [0, 0, 5, 0] });
            content.push({ text: config.carteirinhas[i].Escola, style: "outros", margin: [0, 0, 5, 0] });

            content.push({ text: config.carteirinhas[i].NomeTurma, style: "outros", margin: [0, 0, 5, 0] });

            content.push({ text: "RG: " + config.carteirinhas[i].Rg, style: "outros", margin: [0, 0, 5, 0] });

            if (mod == 3) {
                content.push({ text: "Válido até  " + config.carteirinhas[i].Validade, style: "validade", margin: [0, -9, 150, 0], pageBreak: "after" });
            } else {
                content.push({ text: "Válido até  " + config.carteirinhas[i].Validade, style: "validade", margin: [0, -9, 150, 0] });
            }
        }

        var doc = {
            background: background,
            content: content,
            styles: {
                title: {
                    bold: true,
                    color: '#459ad6',
                    alignment: 'center',
                    fontSize: 20
                },
                nome: {
                    bold: true,
                    color: "#fff",
                    alignment: "right",
                    fontSize: 11
                },
                apelido: {
                    bold: true,
                    color: "#459ad6",
                    alignment: "right",
                    fontSize: 20
                },
                obs: {
                    alignment: "justify",
                    fontSize: 10
                },
                outros: {
                    color: "#fff",
                    alignment: "right",
                    fontSize: 9
                },
                validade: {
                    color: "#fff",
                    alignment: "right",
                    fontSize: 8
                },
                codigo: {
                    color: "#fff",
                    fontSize: 8
                }
            },
            images: {
                foto: "data:image/jpeg;base64,",
                bg: 'data:image/png;base64,',
                arco: 'data:image/png;base64,'
            }
        }

        return doc;
    };

    sedPdfExporter.exportPdf(config);
}

