function RetornaDiaAtual() {

    var diaAtual = new Date();
    var dd = diaAtual.getDate();
    var mm = diaAtual.getMonth() + 1;

    var yyyy = diaAtual.getFullYear();
    if (dd < 10) {
        dd = '0' + dd
    }
    if (mm < 10) {
        mm = '0' + mm
    }
    return diaAtual = dd + '/' + mm + '/' + yyyy;

};

